import React from 'react';
import { useParams } from 'react-router-dom';

const Page3 = () => {
    const { id } = useParams();

    return (
        <div>
            <h2>This is Page 3</h2>
            <p>ID from URL: {id}</p>
        </div>
    );
};

export default Page3;
